import React,{Component, Suspense} from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

class HomePage extends Component{
    constructor(props){
        super(props);
        this.state={}
    }
    render(){
        return(
            <div>
                <Router>
                    <Suspense fallback="">
                        <Switch>
                                <Route path="/" component="Home"></Route>
                        </Switch>
                    </Suspense>
                </Router>
            </div>
        )
    }
}

export default HomePage;
